style.css:
@-moz-document domain("youtube.com") {
#movie_player {
        overflow: hidden !important;
        position: relative !important;
        height: 50vh !important;
    }
    video.video-stream {
        position: absolute !important;
        top: -25% !important;
        height: 150% !important;
        width: 100% !important;
    }
}
